graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Frontend Components</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "LandingPage" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LandingPage</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Landing Page</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "NavigationBar" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>NavigationBar</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Navigation Bar</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "SearchInterface" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>SearchInterface</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Search Interface</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ProductDisplay" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProductDisplay</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Product Display</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "UserDashboard" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>UserDashboard</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">User Dashboard</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "LandingPage" -> "NavigationBar" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "LandingPage" -> "SearchInterface" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "SearchInterface" -> "ProductDisplay" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "LandingPage" -> "UserDashboard" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
